import logo from './logo.svg';
import './App.css';
import React from "react";
function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(()=>{
    fetch("/api/1")
    .then((res) => res.json())
    .then((data) => setData(data.STOPID));
    console.log(res);
  }, []);
  return (
    <div className="App">
      <header className="App-header">
       <p>{!data ? "Loading...": data}</p>

      </header>
    </div>
  );
}

export default App;
